// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

contract Ticket {
    struct User {
        address userAddr;
        bytes32 name;
        int age;
        bool haveTicket;
    }

    struct Show {
        uint showId;
        string showTitle;
        uint showPrice;
        uint totalNumOfSeat;
    }

    uint256 public startTime;
    uint256 public endTime; 
    
    // 응모자 배열
    address[] public applicantList;
    // 응모자 수
    uint applicantCount;
    // 유저 식별
    mapping (address => User) public users;
    // 좌석 정보 - 유저
    address[] public seats;
    // 공연 정보 배열
    Show[] public showList;
    // 컨트랙트 금액
    uint public amount;

    constructor() payable {
        // 매개변수
        // uint _price, address buyer, address seller
        // require문 이용하여 조건 확인
        // seller 관리자 확인
        showList.push(Show({
            showId: 1,
            showTitle: "Crush Fan meeting",
            showPrice: 0.037 * 1000000000000000000,
            totalNumOfSeat: 3
        }));
        amount = msg.value;
        applicantCount= 0;
    }

    receive() external payable {}

    event Transfer (address indexed buyer, uint value);
    event Book (address indexed user);

	function book() public { // 해당 공연에 응모
        // 유저 정보 입력...
        users[msg.sender] = User({
            userAddr: msg.sender,
            name: "ys",
            age: 24,
            haveTicket: false
        });
        applicantList.push(msg.sender);
        applicantCount++;
		emit Book(msg.sender);
	}

    function random() public {
        // 응모 기간 지난 후에 함수 실행
        
        // users 배열 인덱스에서 좌석 수 만큼 for문 돌리기
        uint num = showList[0].totalNumOfSeat;
        uint userNum = applicantList.length;
        uint randNonce = 0;
        uint value;
        address winner;
        for (uint i = 0; i < num; i++) {
            randNonce ++;
            // 이미 나왔던 값인 경우 새로 값 나올때까지 진행
            // 유저 수 범위 내로 돌려서, 순서대로 좌석 할당
            do {
                value = uint(keccak256(abi.encodePacked(block.timestamp,msg.sender,randNonce))) % userNum;
                winner = applicantList[value]; // 해당 주소
            } while(users[winner].haveTicket == true); // 중복 여부

            seats.push(winner);
            users[winner].haveTicket = true;
        }
    }

    function buyTicket(address payable _seller) public payable returns(bool sufficient) {
        require(amount > 0, "No Ether sent");
        require(users[msg.sender].haveTicket == true, "don't have ticket"); // 당첨자인지 확인
        address buyer = msg.sender;
        address payable seller = _seller;

        // uint amount = showList[0].showPrice;

        // 공연 주최자 - 구매자 간 계약 성립
        seller.transfer(amount);
        emit Transfer(buyer, amount);
        return true;
    }

    function get() public view returns (address[] memory) {
        return applicantList;
    }

    function getSeats() public view returns (address[] memory) {
        return seats;
    }
}
